  \"2016-03-24T07:04:05.118248\",\n\t\"name\": \"park-evaluation-scores-starting-fiscal-year-2015\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Since 2005, the San Francisco Park Evaluation
  Program (SFPEP) has regularly evaluated and assessed the conditions of all San Francisco
  civic plazas and squares, mini parks, neighborhood parks and playgrounds, parkways
  and regional parks. The City Services Auditor division of the Controlleru2019s Office
  and Recreation & Parks Department (RPD) staff conduct quarterly evaluations and
  use the results to communicate the condition of San Franciscou2019s parks to RPD
  management and park staff, elected officials, and the public, and to improve park
  conditions by efficient resource allocation and improved maintenance. Starting with
  fiscal year 2015, the data are collected and maintained in a source system with
  the Contoller's office, prior historic data will be provided by Rec and Park.\",\n\t\"license_title\":
